import React from 'react';
import '../Aboutme.css'

export class Aboutme extends React.Component {
  render() {
    return (
      <div className="About-me">
        <h3>About me</h3>
        <p className='Aboutme-text'>Accomplished Software developer with 7+ years of experience focusing in web development. Extensive knowledge in UI development and Salesforce platform, proficient with related tools and technologies. High performant especially in fast-paced customer facing environments, showcasing quality work and deliverables. </p>
      </div>
    )
  }
}

export default Aboutme
